We have a Tooltip component that we want to use in different parts of our NextJS application. The problem is that the Tooltip component is isolated from itself and doesn't have a scope context.

This means that if we open a Tooltip in one part of the application, and then open another Tooltip in another part of the application, both Tooltips will be open at the same time.

We want to be able to close the previously opened Tooltip when we open a new Tooltip.

## The Solution

To solve this problem, we can use React Context to create a global state for the Tooltip component. This will allow us to keep track of the currently open Tooltip and close it when we open a new Tooltip.

Here's how we can do it:

1. Create a new file called `TooltipContext.js` in the `context` folder.

```javascript
import React, { createContext, useState } from 'react';

export const TooltipContext = createContext();

export const TooltipProvider = ({ children }) => {
  const [openTooltip, setOpenTooltip] = useState(null);

  const closeTooltip = () => {
    setOpenTooltip(null);
  };

  const openTooltipHandler = (id) => {
    setOpenTooltip(id);
  };

  return (
    <TooltipContext.Provider value={{ openTooltip, closeTooltip, openTooltipHandler }}>
      {children}
    </TooltipContext.Provider>
  );
};
```

In this file, we create a new context called `TooltipContext` and a provider component called `TooltipProvider`. The `TooltipProvider` component takes in `children` as a prop and sets up the state for the Tooltip component.

We create a state variable called `openTooltip` which will keep track of the currently open Tooltip. We also create two functions called `closeTooltip` and `openTooltipHandler`. The `closeTooltip` function will set the `openTooltip` state to `null`, which will close the currently open Tooltip. The `openTooltipHandler` function will take in an `id` as a parameter and set the `openTooltip` state to that `id`.

2. Wrap the entire application with the `TooltipProvider` component in `_app.js`.

```javascript
import { TooltipProvider } from '../context/TooltipContext';

function MyApp({ Component, pageProps }) {
