To create a Chrome extension that takes screenshots of the current tab and saves them to the desktop, follow these steps:

1. Create a new folder for your extension and create the following files inside it:

- `manifest.json`
- `background.js`
- `content.js`
- `popup.html`
- `popup.css`
- `icons` folder (containing the icon images)

2. Add the following code to `manifest.json`:

```json
{
  "manifest_version": 2,
  "name": "Screenshotter",
  "version": "1.0",
  "description": "Take screenshots of the current tab and save them to the desktop",
  "icons": {
    "16": "icons/icon16.png",
    "48": "icons/icon48.png",
    "128": "icons/icon128.png"
  },
  "background": {
    "scripts": ["background.js"],
    "persistent": false
  },
  "browser_action": {
    "default_icon": "icons/icon48.png",
    "default_popup": "popup.html"
  },
  "permissions": [
    "activeTab",
    "<all_urls>",
    "downloads"
  ]
}
```

3. Add the following code to `background.js`:

```javascript
chrome.browserAction.onClicked.addListener((tab) => {
  chrome.tabs.captureVisibleTab((screenshotUrl) => {
    const fileName = `screenshot_${Date.now()}.png`;
    const downloadItem = {
      url: screenshotUrl,
      filename: fileName,
      saveAs: true
    };

    chrome.downloads.download(downloadItem);
  });
});
```

4. Add the following code to `popup.html`:

```html
<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Screenshotter</title>
  <link rel="stylesheet" href="popup.css">
</head>
<body>
  <h1>Screenshotter</h1>
  <button id="capture-button">Capture Screenshot</button>
  <script src="content.js"></script>
</body>
</html>
```

5. Add the following code to `popup.css`:

```css
body {
  width: 300px;
  height: 150px;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
}

button {
  padding: 10px 20px;
  font-size: 16px;
  cursor: pointer;
}
```

6. Add the following code to `content.js`:

```javascript
document.addEventListener('DOMContentLoaded', () => {
