    if (c >= 'A' && c <= 'Z') {
      c = c - 'A' + 'a';
    }
    if (c >= 'a' && c <= 'z') {
      int index = c - 'a';
      Serial.print(morseCode[index]);
      Serial.print(" ");
      playMorseCode(morseCode[index]);
    } else if (c == ' ') {
      Serial.print(" ");
      delay(wordSpaceDuration);
    }
  }

  // add a space between words
  Serial.println();
  delay(wordSpaceDuration);
}

void playMorseCode(const char* morseCode) {
  for (int i = 0; i < strlen(morseCode); i++) {
    if (morseCode[i] == '.') {
      // play a dot
      tone(9, 1000, dotDuration);
      delay(spaceDuration);
    } else if (morseCode[i] == '-') {
      // play a dash
      tone(9, 1000, dashDuration);
      delay(spaceDuration);
    }
  }
  // add a space between elements of the same letter
  delay(letterSpaceDuration);
}
