function pack(entities) {
  const buf = new ArrayBuffer(entities.length * 1);
  const view = new DataView(buf);
  entities.forEach((entity, i) => {
    view.setUint8(i, (entity.id << 3) | entity.size);
  });
  return buf;
}

function unpack(buf) {
  const view = new DataView(buf);
  const entities = [];
  for (let i = 0; i < view.byteLength; i++) {
    const entity = {
      id: view.getUint8(i) >> 3,
      size: view.getUint8(i) & 0x07
    };
    entities.push(entity);
  }
  return entities;
}
```
