In this article, we will learn how to write a CSV downloader using web workers in the Ember Octane framework.

## Prerequisites

To follow along with this article, you should have a basic understanding of the following:

1. Ember Octane
2. Web Workers

## What is a CSV downloader?

A CSV downloader is a feature that allows users to download data in CSV format.

## Why use web workers?

Web workers allow us to run JavaScript code in the background without blocking the main thread. This is useful for tasks that take a long time to complete, such as generating a CSV file. By using web workers, we can ensure that the user interface remains responsive while the CSV file is being generated.

## Creating the web worker

First, we need to create a web worker. We can do this by creating a new file called `csv-worker.js` in the `public` directory.

In this file, we will define the web worker and the functions that it will use to generate the CSV file.

Here is an example of what the `csv-worker.js` file might look like:
```javascript
self.addEventListener('message', function(e) {
  var data = e.data;
  switch (data.cmd) {
    case 'start':
      self.postMessage('WORKER STARTED: ' + data.msg);
      break;
    case 'generate':
      generateCSV(data.data);
      break;
  }
}, false);

function generateCSV(data) {
  var csvContent = 'data:text/csv;charset=utf-8,';
  data.forEach(function(row) {
    let rowString = row.join(',');
    csvContent += rowString + '\r\n';
  });

  var encodedUri = encodeURI(csvContent);
  var link = document.createElement("a");
  link.setAttribute("href", encodedUri);
  link.setAttribute("download", "data.csv");
  document.body.appendChild(link);
  link.click();
  document.body.removeChild(link);
}
```
